import Link from 'next/link';

const About = () => (
  <div>
    <h1>About</h1>
    <Link href="/">
      <a >go to home</a>
    </Link>
    <p>A Javascript Programmer</p>
    <img src="/static/javascript-logo.png" alt="Javascipt" height="200px"/>
  </div>
);

export default About;
